import React from 'react';
// import {Route, BrowserRouter as Router} from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Form from 'react-bootstrap/Form';
import FormControl from 'react-bootstrap/FormControl';

import logo from '../../assets/logo.svg';

import '../../scss/navbar.scss';


export default function NavBar() {
  return (
    <>
      <Navbar
        collapseOnSelect
        expand="lg"
        variant="dark"
        className="navbar-scss"
      >
        <Navbar.Brand href="#home" id="store-name">
          <img src={logo} alt="logo" id="store-logo" />
          Game Nation
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="responsive-navbar-nav" />
        <Navbar.Collapse id="responsive-navbar-nav">
          <Nav className="mr-auto">
            <Nav.Link href="#store">Store</Nav.Link>
            <NavDropdown title="Browse" id="collasible-nav-dropdown">
              <NavDropdown.Item href="#action/3.1">Action</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.2">Indie</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.3">Adventure</NavDropdown.Item>
              <NavDropdown.Divider />
              <NavDropdown.Item href="#action/3.4">RPG</NavDropdown.Item>
            </NavDropdown>
          </Nav>
          <Form inline>
            <FormControl
              type="text"
              placeholder="Search"
              className=" mr-sm-2"
              id="navbar-search"
            />
          </Form>
          <Navbar.Brand href="#account" alt="account icon">
            {accountIcon}
          </Navbar.Brand>
          <Navbar.Brand href="#favorites" alt="favorites icon">
            {favoritesIcon}
          </Navbar.Brand>
          <Navbar.Brand href="#cart" alt="cart icon">
            {cartIcon}
          </Navbar.Brand>
        </Navbar.Collapse>
      </Navbar>
    </>
  );
}
